.AboutGif {
    width: 100%;
    margin: 100px 0px;
    opacity: 0;
    transition: all;
}

    .AboutGif-Wrap {
        width: 100%;
        height: 100%;
        position: relative;
        display: flex;
        justify-content: center;
    }

            .AboutGif-Image {
                width: 100%;
            }

